import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { client } from '../../clientaxios/Clientaxios';

export default function Admission() {
  const [formDataList, setFormDataList] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await client.get('/study');
        console.log('Response from backend:', response.data);

        const admissions = response.data.admissions || [];
        setFormDataList(admissions);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching form data:', error);

        if (error.response && error.response.data && error.response.data.error) {
          setError(error.response.data.error);
        } else {
          setError('Error fetching data. Please try again.');
        }
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  const handleDelete = async (id) => {
    try {
      await client.delete(`/study/${id}`);
      setFormDataList((prevData) => prevData.filter(formData => formData._id !== id));
    } catch (error) {
      console.error('Error deleting form data:', error);
      if (error.response && error.response.data && error.response.data.error) {
        setError(error.response.data.error);
      } else {
        setError('Error deleting data. Please try again.');
      }
    }
  };  

  return (
    <div>
      <div className="container-fluid">
        <div className="container mt-4">
          <h2>Admission Form</h2>
          {loading ? (
            <p>Loading...</p>
          ) : error ? (
            <p>{error}</p>
          ) : formDataList.length > 0 ? (
            <table className="table">
              <thead>
                <tr>
                  <th>Full Name</th>
                  <th>Father's Name</th>
                  <th>Father's Occupation</th>
                  <th>Email</th>
                  <th>Date of Birth</th>
                  <th>Gender</th>
                  <th>Marital Status</th>
                  <th>Nationality</th>
                  <th>Religion</th>
                  <th>Mother Tongue</th>
                  <th>Educational Qualification</th>
                  <th>Phone Number</th>
                  <th>Address</th>
                  <th>Courses</th>
                  <th>Delete</th>
                </tr>
              </thead>
              <tbody>
                {formDataList.map((formData) => (
                  
                  <tr key={formData._id}>
                    <td>{formData.fullName}</td>
                    <td>{formData.fatherName}</td>
                    <td>{formData.fatherOccupation}</td>
                    <td>{formData.email}</td>
                    <td>{new Date(formData.dateOfBirth).toLocaleDateString()}</td>
                    <td>{formData.gender}</td>
                    <td>{formData.maritalStatus}</td>
                    <td>{formData.nationality}</td>
                    <td>{formData.religion}</td>
                    <td>{formData.motherTongue}</td>
                    <td>{formData.educationalQualification}</td>
                    <td>{formData.phoneNumber}</td>
                    <td>{formData.address}</td>
                    <td>{formData.courses.join(', ')}</td>
                    <td>
                      <button
                        className="btn btn-danger"
                        onClick={() => handleDelete(formData._id)}
                      >
                        Delete
                      </button>
                    </td>
                  </tr>
                ))}
                 console.log('FormData:', formData); 
              </tbody>
            </table>
          ) : (
            <p>No data available</p>
          )}
        </div>
      </div>
    </div>
  );
}
